{"14": ["Мощный и злой, несмотря на скромный размер, только береги пальцы! Люблю эту фирму, купила на смену старому легендарному Вихрю, поскольку сдох аккумулятор и нигде не продаётся. Теперь у меня два рыжих зверюги потому, что запасной аккум подошёл и к старому!\nНичем не уступает бошам и макитам, при этом цена - просто сказочная.", "2021-02-11T07:38:24Z", "черный, светло-оранжевый", "0", 1, 0, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 45Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "18": ["Прошло 6 мес. Сгорел", "2020-12-16T15:05:03Z", "черный, светло-оранжевый", "0", 2, 0, 1, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 45Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "22": ["Отличный, шустрый очень, заряд держит оч долго! \nРекомендую", "2020-07-23T14:33:32.308786565Z", "черный, светло-оранжевый", "0", 3, 0, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 45Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "25": ["Отличный шурик, доволен!", "2019-06-30T14:53:09.901421316Z", "черный, светло-оранжевый", "0", 3, 0, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 33Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "32": ["Шурик для дома норм.Единственный минус плохо держит патрон биты. Во время работы бита иногда вываливается из патрона.", "2020-10-17T08:40:16Z", "черный, светло-оранжевый", "0", 0, 1, 4, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 45Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "33": ["9 месяцев  в работе, нареканий нет.", "2020-10-10T18:06:32Z", "черный, светло-оранжевый", "0", 1, 0, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 45Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "36": ["Шуруповерт с одним не рабочим аккумулятором. В личном кабинете дважды отправляли претензии, один раз отклонили претензию по причине малой информации, хотя были приложены фото, теперь требуют видео, отправили, но ответа нет. Остался вопрос - для чего нам покупать товар, а потом спорить с продавцом - наверно от скуки? Если бы товар был исправлен, его не стали бы возвращать. Очень печально.", "2020-09-28T10:16:30Z", "черный, светло-оранжевый", "0", 2, 0, 1, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 45Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "37": ["Получили товар. И вроде все проверили. Но когда дома попытались для пробы  вкрутить шуруп поняли, что на медленных оборотах он не крутит. Пытались сдать не тут то было. Сказали оформить  претензию по возврату из- за брака в личном кабинете и только когда ее согласуют и разрешат шуруповерт примут обратно и вернут деньги. 18.09.20 оформили претензию, сегодня 25.09.20 никакого одобрения. Заявка все еще на рассмотрении. Сказали что согласовывают в течении 5 рабочих дней. Мы все ждем. Шуруповерт лежит. Чем дело закончится даже не знаю. Отпишусь позже. Товар не рекомендую. Лучше брать такие вещи в других магазинах.", "2020-09-25T07:33:06Z", "черный, светло-оранжевый", "0", 1, 0, 1, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 45Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "39": ["Заказывал данную модель. \nОпять же по отзывам.\nПришла \"Интерскол\"???\nЭто как так можно работать этой компании . \nА потом удивляемся почему у нас самолёты падают!", "2020-09-17T16:19:50Z", "черный, светло-оранжевый", "0", 2, 1, 1, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 45Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "41": ["Купил из за отзывов. Кто хочет купить шуруповерт покупайте другой.", "2020-09-15T20:16:13Z", "черный, светло-оранжевый", "0", 2, 1, 2, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 45Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "42": ["Решение о покупке данного шуруповерта было продиктовано отзывами. Наверное мне не повезло. Брак. Зарядное устройство не рабочее.", "2020-09-13T19:22:59Z", "черный, светло-оранжевый", "0", 2, 0, 3, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 45Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "44": ["На первый взгляд, шуруповерт достойный. Оба аккумулятора в комплекте заряжены, крутит хорошо, момент на режиме дрели достаточный.", "2020-09-12T07:00:27Z", "черный, светло-оранжевый", "0", 0, 1, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 45Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "47": ["Вроде 18вт а крутит как 10-12 Dewalt.\r\nБрал по совету строителя у него постоянно раскручивался патрон если полы гипс и т.д много крутить патрон заипет. и чем больше-тяжелее нагрузка тем он быстрее раскручивается.\r\nИтог если именитый бренд брать по скидке Dewalt стоит 6-7 по скидке можно ухватить за 5 и не смотря на менший Вт-аж крутит лучше", "2020-09-03T18:11:10Z", "черный, светло-оранжевый", "0", 1, 1, 3, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 45Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "48": ["Спустя 2 месяца появился люфт, и странный звук работы редуктора. Батарею держит средне, не особо впечатлен.", "2020-09-01T06:21:15Z", "черный, светло-оранжевый", "0", 2, 0, 2, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 45Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "49": ["Пока все работает, в деле не проверяли", "2020-08-28T15:21:54Z", "черный, светло-оранжевый", "0", 0, 1, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 45Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "50": ["Сегодня получил, упаковка в целостности, всё рабочее, соответствие описанию. Рекомендую.", "2020-08-23T16:43:02Z", "черный, светло-оранжевый", "0", 1, 1, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 45Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "51": ["Очень слабенький. Заряжали аккумуляторы долго- бесполезно. Начиталась хвалебных отзывов тут, но для себя уже поняла, что надо брать проверенные марки. А это- дешевка.", "2020-08-21T20:45:47Z", "черный, светло-оранжевый", "0", 4, 4, 2, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 45Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "52": ["Пришел рабочий, не знаю как дальше но пока довольна", "2020-08-17T20:04:17Z", "черный, светло-оранжевый", "0", 2, 1, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 45Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "53": ["Товар хороший, муж очень доволен покупкой.", "2020-08-16T09:46:14Z", "черный, светло-оранжевый", "0", 2, 0, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 45Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "54": ["Как шуруповерт нормальный, как дрель не очем, так и не получилось метал 2мм просверлить, пришлось в розетку нормальную дрель подсоединять.", "2020-08-09T11:08:24Z", "черный, светло-оранжевый", "0", 6, 0, 4, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 45Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "56": ["Все работает. Пока доволен", "2020-08-13T12:37:29Z", "черный, светло-оранжевый", "0", 1, 0, 4, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 45Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "57": ["Шуропеверт пришол с браком одна батарея неработает осадок неприятный очень плохо работает ваша проверка больше с вами не хочу иметь никаких покупок", "2020-08-13T08:56:10Z", "черный, светло-оранжевый", "0", 5, 1, 1, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 45Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "58": ["Шуруповёрт отличный! Выбирал муж, очень доволен! У нас строится дом, крутит очень много им.", "2020-08-09T01:08:43Z", "черный, светло-оранжевый", "0", 1, 0, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 45Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "59": ["Огонь, а не шуруповёрт. Зарядки на долго хватает. Незаменим просто в доме. И ещё за такую цену.", "2020-07-21T16:32:17.43571227Z", "черный, светло-оранжевый", "0", 2, 2, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 45Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "60": ["Отличный шуруповерт, покупала мужу в подарок. Он очень доволен, аккумулятор держит заряд хорошо, работает бодро. Биты одноразовые, но при заказе я так и предполагала, что нужно заказывать отдельно, так что все устроило", "2020-07-16T14:07:38.63550105Z", "черный, светло-оранжевый", "0", 7, 1, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 45Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "61": ["Класс! Очень нравиться и хороший чемоданчик куда все складывается.", "2020-05-16T19:39:40.413299676Z", "черный, светло-оранжевый", "0", 3, 7, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 35Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "63": ["Купил данный девайс. Все хорошо, но появился один минус - блок питания не работает. Сломался на первой зарядке аккумулятора. Индикатор не горит и сама зарядка не идет. Вопрос: где взять такой блок питания?", "2020-07-09T19:43:53.036854438Z", "черный, светло-оранжевый", "0", 3, 2, 3, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 45Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "64": ["Отличный шуруповёрт.", "2020-07-04T22:05:37.712846622Z", "черный, светло-оранжевый", "0", 1, 2, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 45Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "65": ["есть смысл перезаказывать ? \nпришел Шурик в кейсе все как положено ,запечатан ,но на картинке другой шуруповёрт ,не соответствует той картинке что на сайте при заказе ! \nСделал возврат ,деньги вернули через 4 дня ,кому то приходил тот что и должен как на сайте Шурик ,Но это мало кому как я понял , остальные не замечают, либо боты ,либо продажные отзывы ...", "2020-06-27T15:36:45.35496876Z", "черный, светло-оранжевый", "0", 6, 17, 1, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 45Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "67": ["Отличный инструмент!", "2020-06-30T16:32:29.55051429Z", "черный, светло-оранжевый", "0", 2, 3, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 45Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "68": ["Мужу очень понравился,все очень добротно сделано,крепкий,много чего уже им сделал,никаких нареканий,советую", "2020-06-26T10:44:13.566697112Z", "черный, светло-оранжевый", "0", 3, 3, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 45Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "69": ["Спасибо за товар. Все отлично работает.", "2020-06-24T16:47:05.572773224Z", "черный, светло-оранжевый", "0", 2, 0, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 45Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "70": ["Товар пришёл без повреждений. В работе без нареканий , покупка радует.", "2020-06-23T10:44:03.981280731Z", "черный, светло-оранжевый", "0", 2, 0, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 45Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "71": ["После двух месяцев использования, сгорел двигатель, развалился редуктор и сгорела кнопка", "2020-06-17T05:44:11.871505618Z", "черный, светло-оранжевый", "0", 11, 1, 1, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 45Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "72": ["Не соответствует описанию. Пользовался такой же моделью, хороший Шурик. а этот, вроде такая же модель а шуруповёрт совсем другой. Прям в пункте выдачи начал проверять патрон прокручивался.", "2020-06-11T15:18:40.630285657Z", "черный, светло-оранжевый", "0", 9, 1, 1, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 45Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "74": ["Брала для себя, мне очень понравилось ☺️🙌🏻", "2020-06-11T01:58:06.25769685Z", "черный, светло-оранжевый", "0", 2, 1, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 45Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "77": ["На 4. Хлипковато как-то. Приходится докручивать отверткой.  Сойдет и так конечно. Но...", "2020-06-09T17:46:54.945395756Z", "черный, светло-оранжевый", "0", 3, 1, 4, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 45Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "79": ["Просто космос 🚀 ", "2020-06-09T13:23:01.711389312Z", "черный, светло-оранжевый", "0", 2, 1, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 45Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "80": ["Пришел полный комплект,мужу понравилось покупкой очень довольны!", "2020-06-09T07:56:22.049092864Z", "черный, светло-оранжевый", "0", 1, 1, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 45Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "81": ["Одна батарея неработает", "2020-06-06T12:59:05.231422311Z", "черный, светло-оранжевый", "0", 1, 0, 2, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 45Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "82": ["Маленькая, но мощная, мужу понравилась. Будем крутить профиль.", "2020-06-03T07:23:50.461125715Z", "черный, светло-оранжевый", "0", 1, 0, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 35Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "84": ["Дефект в патроне, крутится криво", "2020-05-31T21:34:23.76466536Z", "черный, светло-оранжевый", "0", 5, 0, 2, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 35Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "85": ["Неплохой бюджетный шуруповёрт. Только получил , на одном аккумуляторе закрутил сотни две саморезов 95мм в брус. Хорошо лежит в руке, не тяжёлый. Не удобный индикатор заряда ( на блоке питания). Не понравился патрон, постоянно раскручивается и теряет биту, уточню, может можно заменить патрон.", "2020-05-31T18:36:08.412050397Z", "черный, светло-оранжевый", "0", 5, 0, 4, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 35Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "88": ["Муж доволен, все работает, в руке удобно держать. Спасибо магазину!", "2020-05-29T14:16:20.845305048Z", "черный, светло-оранжевый", "0", 1, 0, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 35Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "89": ["Всё замечательно", "2020-05-27T13:42:25.296891913Z", "черный, светло-оранжевый", "0", 1, 2, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 35Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "90": ["заказ пришел быстро, все работает, со своей функцией справляется", "2020-05-26T11:30:10.28404824Z", "черный, светло-оранжевый", "0", 1, 0, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 35Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "92": ["Компактный, мощный, для дома в самый раз и даже более! Пришел полностью укомплектованным, в отличном рабочем состоянии! Муж в восторге! Довольны на все 100%!Спасибо магазину и производителю!", "2020-05-21T18:01:34.244949498Z", "черный, светло-оранжевый", "0", 5, 0, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 35Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "93": ["Доставили на следующий день. Всё хорошо запечатано. Ничего не поломано. Всё работает. Шуруповерт понравился. В деле еще не пробовали. На вид всё очень качественно.", "2020-05-18T13:06:40.392734084Z", "черный, светло-оранжевый", "0", 0, 5, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 35Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "94": ["Шуруповёрт отличный, за эти деньги оправдывает себя полностью!", "2020-05-13T08:44:15.125532214Z", "черный, светло-оранжевый", "0", 1, 5, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 35Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "95": ["Пришло все целое, в плёнке, с хомут ком на ручке. Вскрыла  на месте, все проверила, товар пришёл без повреждений, рабочий, полный комплект. Испробовали: работает хорошо, достаточно лёгкий. Нет индикаторов заряда, это минус. А так все понравилось. За 3600р - супер!", "2020-05-12T16:41:51.848272547Z", "черный, светло-оранжевый", "0", 4, 3, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 35Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "96": ["Кейс Шурика нарушен, не работает первая скорость не работает, сильный запах пластика не рекомендую", "2020-05-11T12:51:52.213558419Z", "черный, светло-оранжевый", "0", 5, 1, 1, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 35Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "97": ["Заказ пришел быстро, доставка курьером,но есть одно большое НО!!! В комплекте нет зарядного устройства 😔 Очень расстроились...Мой первый заказ был и неудачный... Теперь только ждать когда рассмотрят мою заявку на брак... Буду надеяться что вернут деньги...", "2020-05-10T16:19:24.091651105Z", "черный, светло-оранжевый", "0", 5, 0, 2, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 35Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "98": ["Качественно сделан , в работе супер !", "2020-05-10T11:42:00.749353351Z", "черный, светло-оранжевый", "0", 5, 3, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 35Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "99": ["Добры день. Товар хорошо упакован без повреждении, работает, размер оказался меньше, чем рассчитывали. Надеюсь, долго прослужит.", "2020-05-07T15:05:39.613827561Z", "черный, светло-оранжевый", "0", 4, 1, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 35Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "100": ["Вчера получили, немного поработали, пока все нормально, маленький, но мощный, 3\n2 скорости.", "2020-05-07T07:38:13.947862111Z", "черный, светло-оранжевый", "0", 1, 0, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 35Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "101": ["Переслал работать. Настроены", "2020-05-05T14:25:35.627344876Z", "черный, светло-оранжевый", "0", 1, 3, 1, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 35Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "102": ["Хорошая дрель-шуруповерт. И то и то достойно в применении. Теплица была собрана на одной батарее не заражая после покупки. Сверлил и крепил саморезы. Все вытянула. Доволен.", "2020-05-05T12:18:19.118545074Z", "черный, светло-оранжевый", "0", 2, 0, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 35Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "103": ["Хороший товар, претензий нет.", "2020-04-29T17:09:39.446010149Z", "черный, светло-оранжевый", "0", 0, 1, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 35Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "104": ["Нормальный Шурик, батарея хорошая ток вот бита переодически вываливается", "2020-04-26T03:07:57.047962742Z", "черный, светло-оранжевый", "0", 5, 0, 4, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 35Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "105": ["Муж очень доволен ", "2020-04-24T19:35:44.318868422Z", "черный, светло-оранжевый", "0", 2, 0, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 35Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "106": ["Расхождение по характеристикам на сайте и на коробке от шурика. Качество товара не очень после боша. На стойке не проверил 1 скорость, пришёл домой а она и не работает-зажима нет. Понёс обратно, там каким то чудом после нескольких безуспешных попыток заработала, кароче не знаю на сколько его хватит и почему его так все хвалят, как по мне лучше все таки добавить и взять макиту или бош. Покупал кстати по отзывам.", "2020-04-20T10:52:50.489753328Z", "черный, светло-оранжевый", "0", 16, 2, 3, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 35Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "107": ["Супер! Сын очень доволен. Очень полезная вещь!", "2019-12-26T12:33:06.867165595Z", "черный, светло-оранжевый", "0", 5, 4, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 33Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "109": ["Удобный, компактный Шурик. Но один из акб битый, см. фото. Не критично, работает. Но не приятно. Поэтому оценка кол.", "2020-04-16T16:40:30.489932814Z", "черный, светло-оранжевый", "0", 3, 0, 1, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 33Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "111": ["Купила за 2845 руб. Супруг у меня очень избирателен к таким инструментам. Но после определенных испытаний сказал,что шуруповерт-огонь! Пришло все в заводской упаковке. Все на месте и в рабочем состоянии. Спасибо!!!", "2020-04-10T17:27:53.765707016Z", "черный, светло-оранжевый", "0", 1, 2, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 33Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "112": ["Купили шуруповёрт 21.03.20г,все было хорошо упаковка целая, вся комплектация...решили испробовать в деле и он задымился. Больше этот инструмент не работаешь. Это просто кошмар три с копейками в мусор.", "2020-04-10T08:33:01.660552597Z", "черный, светло-оранжевый", "0", 2, 0, 1, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 33Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "115": ["Покупка пришлась на \"черную пятницу\". Цена составила 2492 р. \nВ работе пока не пробовал, но на первый взгляд инструмент внушает доверие. Патрон не бьет, подсветка работает, 2 АКБ заряжены. \nПобольше бы таких \" черных пятниц\".", "2019-11-28T15:41:12.335798192Z", "черный, светло-оранжевый", "0", 2, 2, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 33Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "117": ["Хороший шуруповёрт, лучше чем именитые аналоги, которые дороже", "2020-04-02T18:12:48.935737704Z", "черный, светло-оранжевый", "0", 1, 1, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 33Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "118": ["Отличный шуруповерт пришло все целое хорошо упаковано батареики заряжен все работает муж доволен", "2020-03-11T17:52:06.539025881Z", "черный, светло-оранжевый", "0", 1, 0, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 33Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "121": ["Шуруповёрт перестал работать спустя 3 недели со дня покупки. Батарея полность заряженна, подсветка горит, но не крутится патрон. Запах горелой изоляции. В наличии много инструмента фирмы \"Вихрь\", проблем не было, а с шуруповертом не повезло.", "2020-03-19T16:31:07.767646219Z", "черный, светло-оранжевый", "0", 5, 0, 1, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 33Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "122": ["Добротный шуруповерт, выбирали между ним и дорогим фирмы Макита. Сошлись во мнении, что пользоваться им приходится не часто, поэтому переплачивать нет смысла. Для домашнего использования в самый раз. Единственное - это сразу докупите набор бит, т.к. в комплекте их мало и не оказалось ходовой. Товар пришел без брака, всё ок)", "2020-03-18T11:10:06.378847882Z", "черный, светло-оранжевый", "0", 1, 0, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 33Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "123": ["Шурик за свои деньги хороший,минус воняет дешёвым пластиком", "2020-03-14T15:55:48.228521351Z", "черный, светло-оранжевый", "0", 1, 1, 4, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 33Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "127": ["Товар получил в указанный срок..пока доволен.Не знаю плюс это или минус,но показался мне он довольно легким.Удобный..подсветка не разбита,как ранее писали в коментариях..Кейс был опечан при получении..Проверил заряд батареи после вскрытия,20+В...", "2020-03-08T15:09:13.161428449Z", "черный, светло-оранжевый", "0", 1, 1, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 33Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "129": ["Только для мелких домашних работ.... С более сложными работами не справляется, к сожалению. Из плюсов: два аккумулятора, подсветка и компактность. Отремонтировала старенький Бош для своих целей, а этот теперь у сына-подростка в \"игрушках\".", "2020-03-07T05:47:05.679344814Z", "черный, светло-оранжевый", "0", 1, 1, 3, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 33Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "132": ["Ну так себе\nСудя по отзывам не соответствует", "2020-03-01T18:48:27.74147312Z", "черный, светло-оранжевый", "0", 0, 3, 3, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 33Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "133": ["Все работает, мощности хватает, отец доволен", "2020-02-29T18:10:45.248223225Z", "черный, светло-оранжевый", "0", 1, 1, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 33Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "135": ["Не работает ни один аккамулятор,пришел разряжен,что делать", "2020-02-23T13:03:55.851302699Z", "черный, светло-оранжевый", "0", 1, 6, 1, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 33Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "137": ["Хороший шурик, для домашнего использования самый раз. Берёшь в руки, кажется игрушечный, проверил в работе, работает отлично!", "2020-02-28T18:45:05.198673359Z", "черный, светло-оранжевый", "0", 1, 0, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 33Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "138": ["Шуроповерт хороший. Муж доволен. В Кастораме дешевле такой же.", "2020-02-28T11:06:33.094650566Z", "черный, светло-оранжевый", "0", 1, 0, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 33Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "139": ["Муж счастлив от подарка Сказал что очень хорошая На фото кажется большой а на самом деле миниатюрная в удобном чемодане Пришла целой хорошо упакованной.", "2020-02-27T19:07:32.618747116Z", "черный, светло-оранжевый", "0", 1, 0, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 33Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "140": ["Брала в подарок мужу, он в восторге, все целое, Шурик мощный, спасибо.", "2020-02-27T18:04:34.98035337Z", "черный, светло-оранжевый", "0", 2, 0, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 33Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "142": ["Всем привет! Хочу порекомендовать  данный продукт всем желающие приобрести шурик. Имея ранее такие  бренды как Bosch, Metabo, Makita модель ДА 18 Л- 2k ничем не уступает за исключением функциональности. Большой плюс нет той нервозности и боязни повредить  в эксплуатации, как в  работе с лидерами мировых брендов.\nСоотношение цены и качества в нужном русле.\nВ дальнейшем планирую приобрести модель ДА-24Л-2к.\nИскать, что-то лучше нет смысла. Покупайте и не тратьте время на поиск!\nСпасибо за внимание", "2020-02-25T21:04:29.008412352Z", "черный, светло-оранжевый", "0", 11, 1, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 33Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "143": ["Шуроповерт класный муж в восторге.", "2020-02-24T18:18:14.294772523Z", "черный, светло-оранжевый", "0", 1, 0, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 33Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "144": ["Брал в подарок, коробка вся в царапинах. Относятся к товару не бережно. Вскрыть можно только после оплаты.", "2020-02-24T08:55:32.466767597Z", "черный, светло-оранжевый", "0", 2, 1, 1, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 33Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "148": ["Мужу больше понравился другой, отказ в пользу другова Шурика, прошу не снижать процент", "2020-02-22T16:08:18.858647026Z", "черный, светло-оранжевый", "0", 1, 0, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 33Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "151": ["За 5-7 мин проверки шуруповерта, чудным образом перестала работать подсветка.(прошу заметить-в пункте выдачи она работала). Дальше выясняем, что то ли  китайцы забыли индикатор заряда батареи, то ли забили на индикатор заряда. Я дальше даже боюсь этот канчалыжный Шурик трогать. Вывод делайте сами, господа. P.S. что делать будем, уважаемые представители бренда?", "2020-02-21T19:41:09.580849476Z", "черный, светло-оранжевый", "0", 5, 6, 2, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 33Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "153": ["Товар соответствует описанию. В чемодане все детали плотно лежат в своих ячейках. Мужу понравился. Когда опробуем в работе, дополнительные отзыв.", "2020-02-20T10:47:33.624393979Z", "черный, светло-оранжевый", "0", 1, 0, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 33Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "155": ["Дрель - супер! Муж выбирал, смотрел по характеристикам. Пришел, открыли.. - прям \"муравей\")) - маленький в размерах. Но требованиям удовлетворяет полностью. Как говорится, мал, да удал.", "2020-02-19T11:29:35.860235048Z", "черный, светло-оранжевый", "0", 2, 0, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 33Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "156": ["Забрав товар с магазина был доволен как слон, товар в заводской упаковке, всё отлично, лёгкий, мощный инструмент. Но в конце осмотра разочаровался, стекло подсветки биты было сломано, эх. Но я думаю в работе шуруповерта это не скажется, залепил скотчем. - 1 звезда.", "2020-02-18T11:42:29.019169938Z", "черный, светло-оранжевый", "0", 4, 1, 4, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 33Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "157": ["Отличный, недорогой шуруповёрт-дрель. В кейсе с основными битами", "2020-02-17T12:46:24.99446727Z", "черный, светло-оранжевый", "0", 1, 0, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 33Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "160": ["Отличная вещь. Пользуемся уже больше полугода и все отлично, нареканий нет", "2020-02-10T07:41:40.691888839Z", "черный, светло-оранжевый", "0", 1, 0, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 33Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "162": ["Поработал пару месяцев и перестал заряжаться.  Плохая центровка патрона. Аккумуляторы быстро садятся. ", "2020-02-08T22:45:28.011731071Z", "черный, светло-оранжевый", "0", 4, 2, 1, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 33Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "163": ["Шуруповерт рабочий без повреждений, аккумуляторы заряжены. В руке удобно держать. В целом все устраивает", "2020-02-07T08:24:05.54280062Z", "черный, светло-оранжевый", "0", 1, 1, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 33Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "164": ["Спасибо!!! Муж очень доволен! \r\n", "2020-02-06T13:48:59.695077891Z", "черный, светло-оранжевый", "0", 1, 0, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 33Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "165": ["Пока все нормально,пришел в заводской упаковке.", "2020-02-06T08:13:31.81366434Z", "черный, светло-оранжевый", "0", 1, 0, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 33Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "166": ["Муж даволен как ребёнок, целый час от него не отходил. Качество хорошее, все хорошо упаковано, инструкция в комплекте.", "2020-02-04T16:20:35.537118041Z", "черный, светло-оранжевый", "0", 2, 0, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 33Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "167": ["Работает все норм. Но в пункте выдачи не поставили штамп о гарантии. Это нормально?", "2020-02-03T18:13:04.97363178Z", "черный, светло-оранжевый", "0", 2, 0, 4, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 33Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "168": ["Брал товарищу в подарок, остался очень доволен! 18 вольт, литий, два аккума в комплекте, 6 бит с держателем и всего за 3200! Идеальное соотношение цены и характеристик.", "2020-02-03T08:51:08.181227779Z", "черный, светло-оранжевый", "0", 1, 0, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 33Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "169": ["сегодня получила товар дрель-шуруповерт. Очень хороший инструмент, если бы не одно но. После проверки обнаружили дефект, разбитое стекло подсветки сверла. прошу не учитывать в проценте выкупа!", "2020-02-01T08:31:26.093256781Z", "черный, светло-оранжевый", "0", 4, 0, 1, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 33Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "170": ["Муж доволен, а это самое главное)) сказал хорошие аккумы, и мощный инструмент! Спасибо производителю и вайлдберризу", "2020-02-01T08:00:03.718946761Z", "черный, светло-оранжевый", "0", 1, 0, 5, "Дрель-шуруповерт аккумуляторная ДА 18Л-2К, 33Нм, 18В, 2х2.0Ач, з/у, кейс", "Вихрь"], "172": ["Сегодня получил \"Шурик\", дост